import * as React from 'react';
import { styled } from '@mui/material/styles';
import Card from '@mui/material/Card';
import CardHeader from '@mui/material/CardHeader';
import CardMedia from '@mui/material/CardMedia';
import CardContent from '@mui/material/CardContent';
import CardActions from '@mui/material/CardActions';
import Avatar from '@mui/material/Avatar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import CheckBoxOutlineBlankIcon from '@mui/icons-material/CheckBoxOutlineBlank';
import MoreVertIcon from '@mui/icons-material/MoreVert';
import { blue, pink, red } from '@mui/material/colors';
import { ClickAwayListener, Grow, MenuItem, MenuList, Paper, Popper } from '@mui/material';


export default function MealCard(props: any) {
  const [open, setOpen] = React.useState(false);
  const anchorRef = React.useRef<HTMLButtonElement>(null);

  const handleToggle = () => {
    setOpen((prevOpen) => !prevOpen);
  };

  const handleClose = (event: Event | React.SyntheticEvent) => {
    if (
      anchorRef.current &&
      anchorRef.current.contains(event.target as HTMLElement)
    ) {
      return;
    }

    setOpen(false);
  };

   // return focus to the button when we transitioned from !open -> open
   const prevOpen = React.useRef(open);
   React.useEffect(() => {
     if (prevOpen.current === true && open === false) {
       anchorRef.current!.focus();
     }
 
     prevOpen.current = open;
   }, [open]);
 
 const { user, meal, image } = props;

  const username = user ? user[0].toUpperCase() : "?";
  const avatarColor = username==="M" ? red[500] : username==="N" ? pink[500] : blue[500];

  //#region base64 image

  const imageUrl = image ? image : "data:image/jpeg;base64,";
  //#endregion

  return (
    <Card>
      <CardHeader
        avatar={
          <Avatar sx={{ bgcolor: avatarColor }} aria-label="recipe">
          {username}
          </Avatar>
        }
        action={
          <IconButton aria-label="more"
          ref={anchorRef}
          id="composition-button"
          aria-controls={open ? 'composition-menu' : undefined}
          aria-expanded={open ? 'true' : undefined}
          aria-haspopup="true"
          onClick={handleToggle}>
            <MoreVertIcon />
          </IconButton>
        }
        title={meal}
      />
       <Popper
          open={open}
          anchorEl={anchorRef.current}
          role={undefined}
          placement="left-start"
          transition
          disablePortal
        >
          {({ TransitionProps, placement }) => (
            <Grow
              {...TransitionProps}
              style={{
                transformOrigin:
                  placement === 'bottom-start' ? 'left top' : 'left bottom',
              }}
            >
              <Paper>
                <ClickAwayListener onClickAway={handleClose}>
                  <MenuList
                    autoFocusItem={open}
                    id="composition-menu"
                    aria-labelledby="composition-button"
                  >
                    <MenuItem onClick={handleClose}>Remove</MenuItem>
                    <MenuItem disabled={true} onClick={handleClose}>Edit</MenuItem>
                  </MenuList>
                </ClickAwayListener>
              </Paper>
            </Grow>
          )}
        </Popper>
      <CardMedia
        component="img"
        height="194"
        image={imageUrl}
      />
      <CardActions disableSpacing>
        <IconButton aria-label="mark as confirmed">
          <CheckBoxOutlineBlankIcon />
        </IconButton>
      </CardActions>
    </Card>
  );
}
